import { AUTH, LOG_OUT } from "../constants";

const initialState = {}
export const authReducer = (state=initialState, action) => {
  switch (action.type) {
    case AUTH:
      return { ...state };
    case LOG_OUT:
      return { ...state };
    default:
      return state;
  }
};
